DROP TABLE IF EXISTS `cm_contract`;
CREATE TABLE `cm_contract`  (
  `contract_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '合同名称',
  `no` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '合同编号',
  `party_a` bigint(20) NOT NULL COMMENT '合同甲方',
  `charge_a` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '甲方负责人',
  `party_b` bigint(20) NOT NULL COMMENT '合同乙方',
  `charge_b` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '乙方负责人',
  `type` bigint(20) NULL DEFAULT NULL COMMENT '合同类型（0 合同类型a 1 合同类型b 2 合同类型c ……）',
  `dept` bigint(20) NOT NULL COMMENT '部门/项目部',
  `rec_pay` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '合同收付类型 （  0 付款 1 收款 2无）',
  `amount` decimal(15, 2) NOT NULL COMMENT '合同金额/元',
  `status` bigint(20) NOT NULL COMMENT '合同状态（0 拟稿中 1 履行中 2 已完成 3 已作废 4 已归档）',
  `sign_time` datetime NOT NULL COMMENT '签订日期',
  `effect_time` datetime NOT NULL COMMENT '合同生效日期',
  `end_time` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '合同结束日期',
  `key_terms` varchar(1000) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '关键条款',
  `comment` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '备注',
  `sort` int(5) NULL DEFAULT NULL COMMENT '排序',
  `top` varchar(5) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '置顶 (0 否 1 是)',
  `deleted` int(11) NULL DEFAULT 0 COMMENT '逻辑删除',
  `version` int(11) NULL DEFAULT 0 COMMENT '版本',
  `create_by` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '创建者',
  `create_dept_by` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '创建部门',
  `update_by` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '更新者',
  `create_time` datetime NULL DEFAULT NULL COMMENT '创建日期',
  `update_time` datetime NULL DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`contract_id`) USING BTREE,
  UNIQUE INDEX `uniq_name`(`name`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '合同档案' ROW_FORMAT = COMPACT;

